  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the study was to evaluate
  the effectiveness of GPS in accomplishing the aims of victim protection via contact
  deterrence during the pretrial period, resulting in an improved quality of life
  for the victims as well as their greater participation in criminal justice proceedings.
  The second aim was to assess whether Global Positioning System (GPS) enrollment
  is associated with deterrence in the long term, as measured by lower likelihood
  of re-arrest during a one-year follow- up period.u00a0\",\n\t\"license_title\":
